Print out two of these, snap the keyboard into the circular parts, and slide your tablet in. If you modify the EPS, you can regenerate the DXF (needed by the OpenSCAD file) with:
pstoedit -dt -f dxf:-polyaslines &quot;VivoTab Stand.eps&quot; &quot;VivoTab Stand.dxf&quot;
(See <a rel="nofollow" href="http://pstoedit.net" >http://pstoedit.net</a> for information on pstoedit).
